data:
/* gochi-hand-regular */
@font-face {
  font-family: 'Gochi Hand';
  font-style: normal;
  font-weight: regular;
  src: url('//lib.baomitu.com/fonts/gochi-hand/gochi-hand-regular.eot'); /* IE9 Compat Modes */
  src: local('Gochi Hand'), local('GochiHand-Normal'),
       url('//lib.baomitu.com/fonts/gochi-hand/gochi-hand-regular.eot?#iefix') format('embedded-opentype'), /* IE6-IE8 */
       url('//lib.baomitu.com/fonts/gochi-hand/gochi-hand-regular.woff2') format('woff2'), /* Super Modern Browsers */
       url('//lib.baomitu.com/fonts/gochi-hand/gochi-hand-regular.woff') format('woff'), /* Modern Browsers */
       url('//lib.baomitu.com/fonts/gochi-hand/gochi-hand-regular.ttf') format('truetype'), /* Safari, Android, iOS */
       url('//lib.baomitu.com/fonts/gochi-hand/gochi-hand-regular.svg#GochiHand') format('svg'); /* Legacy iOS */
}
